de:
Zur Umsetzung der «Swissness»-Gesetzgebung werden vier Verordnungen revidiert beziehungsweise neu erarbeitet. Das Hauptziel der Regelungen ist unverändert: Der Mehrwert der Herkunftsbezeichnung «Schweiz» und des Schweizerkreuzes soll nachhaltig gesichert werden, indem ihr Schutz verstärkt und die Kriterien für ihren Gebrauch geklärt werden. Es geht um folgende vier Verordnungen:

1. Revision der Markenschutzverordnung: Sie präzisiert insbesondere die Herkunftskriterien für industrielle Produkte und das Verfahren zur Löschung von Marken wegen Nichtgebrauchs;

2. Verordnung über die Verwendung der Herkunftsangabe «Schweiz» für Lebensmittel;

3. Verordnung über das Register für Ursprungsbezeichnungen und geografische Angaben für nicht landwirtschaftliche Erzeugnisse;

4. Verordnung über den Schutz des Schweizerwappens und anderer öffentlicher Zeichen.

it:
L'attuazione della legislazione «Swissness» prevede la revisione, rispettivamente l'elaborazione di quattro ordinanze. Lo scopo della nuova regolamentazione è preservare il valore aggiunto della designazione «Svizzera» e della croce Svizzera a lungo termine, precisando i criteri relativi al loro utilizzo. Si tratta delle quattro ordinanze seguenti:
1. Revisione dell'ordinanza sulla protezione dei marchi: sono in particolare precisati i criteri per determinare la provenienza dei prodotti industriali ed è definita la procedura di cancellazione per mancato uso del marchio;

2. Ordinanza sull'utilizzo dell'indicazione di provenienza «Svizzera» per le derrate alimentari;

3. Ordinanza sul registro delle denominazioni d'origine e delle indicazioni geografiche per prodotti non agricoli; 

4. Ordinanza sulla protezione dello stemma della Svizzera e di altri segni pubblici.

fr:
La mise en œuvre de la législation «Swissness» requiert la révision, respectivement l'élaboration de quatre ordonnances. Pour rappel, l'objectif principal de cette réglementation est de préserver la plus-value offerte par la désignation «Suisse» et la croix suisse, en clarifiant les critères de leur utilisation et en renforçant leur protection. Les quatre ordonnances sont les suivantes:

1. La révision de l'ordonnance sur la protection des marques: elle contient notamment des précisions pour définir la provenance géographique des produits industriels et les modalités de la procédure de radiation d'une marque pour défaut d'usage;

2. L'ordonnance concernant l'utilisation de l'indication de provenance «Suisse» pour les denrées alimentaires;

3. L'ordonnance sur le registre des appellations d'origine et des indications géographiques pour les produits non agricoles;

4. L'ordonnance sur les armoiries publiques et autres signes publics.
